import React, { Component, Fragment } from 'react';
import { BrowserRouter, Route } from "react-router-dom";

import Layout from './components/Layout/Layout';
import Home from './components/Pages/Home';
import Feature from './components/Pages/Feature';
import Watch from './components/Pages/Watch';
import Listen from './components/Pages/Listen';
import Price from './components/Pages/Price';

import Header from './components/Partials/Header';
import Footer from './components/Partials/Footer';
import BackButton from './components/Partials/BackButton';
import Timer from './components/Partials/Timer';

class App extends Component {
	render() {
		const baseUrl = process.env.PUBLIC_URL;

		return (
			<Layout>
				<BrowserRouter>
					<Timer />
					<Route exact path={baseUrl + "/"} render={props =>
						<Fragment>
							<Home />
						</Fragment>
					} />
					<Route path={baseUrl + "/feature"} render={props =>
						<Fragment>
							<Header status="white" />
							<BackButton status="white" />
							<Feature />
							<Footer status="white" />
						</Fragment>
					} />
					<Route path={baseUrl + "/watch"} render={props =>
						<Fragment>
							<Header status="black" />
							<BackButton status="black" />
							<Watch />
							<Footer active="watch" status="black" />
						</Fragment>
					} />
					<Route path={baseUrl + "/listen"} render={props =>
						<Fragment>
							<Header status="white" />
							<BackButton status="white" />
							<Listen />
							<Footer active="listen" status="white" />
						</Fragment>
					} />
					<Route path={baseUrl + "/price"} render={props =>
						<Fragment>
							<Header status="white" />
							<BackButton status="white" />
							<Price />
							<Footer active="price" status="white" />
						</Fragment>
					} />
				</BrowserRouter>
			</Layout>
		);
	}
}

export default App;
